    "                #add into self.visited if never visited\n",
    "                if(state_eval not in self.visited):\n",
    "                    self.visited.append(state_eval)\n",
    "                \n",
    "                for i in temp:\n",
    "                    if not (i in self.visited):\n",
    "                        self.Solver.add(i)\n",
    "                        \n",
    "                        # add to visited\n",
    "                        self.visited.append(i)\n",
    "                        yield i\n",
    "                        if (i == self.goalState):\n",
    "                            print(\"\\nReach Goal State:\", i)\n",
    "\n",
